import { useState } from 'react';

import { RuteListComponent } from './RouteListFolder/ruteListComponent';
import { ruteList } from '../data/ruteList';
import { HomeOptions } from './OptionsFolder/homeOptions';
import { NewRuteComponent } from './createRuteFolder/newRuteComponent';

import '../styles/rutesListComponentStyle.css';
import '../styles/homeOptionStyle.css';
import '../styles/homeStyle.css';
import { CompletedRutesComponent } from './completedRutesFolder/completedRutesComponent';



export const Home = () => {

  const [ rutesList , setRutesList ] = useState( ruteList() );

  const [ rutesCompleted, setRutesCompleted ] = useState([]);

    
  return (
    <>
    
    <div className = 'AppContainer'>

      <RuteListComponent rutesList = { rutesList } setRutesList = { setRutesList }  rutesCompleted={rutesCompleted} setRutesCompleted={setRutesCompleted}/>
      <NewRuteComponent  setRutesList = { setRutesList } rutesList = { rutesList }/>
      <CompletedRutesComponent rutesCompleted={rutesCompleted} />
      
    </div>

    </>
    
    
    
  )
}
